import React from 'react';
import propTypes from 'prop-types';

export const InputStyle = ({ id, name, type, change, checked }) => {
  return (
    <input
    id={id}
    name={name}
    type={type}
    onChange={ change }
    checked={checked}
    >
    </input>
  );
}

InputStyle.propTypes = {
  id: propTypes.func,
  name: propTypes.func,
  type: propTypes.func,
  change: propTypes.func,
  checked: propTypes.func
};
